import React from 'react'
import Button from 'react-bootstrap/Button'



export default function Pagination({goNext, goPrev}) {
    return (
        <div class="d-flex">
            <div class="p-2 flex-fill">
                {goPrev && <Button class="d-flex ml-auto" variant="success" onClick={goPrev}>Previous</Button>}
            </div>
            <div class="p-2 flex-fill">Flex item 3</div>
        </div>
    )
}
